import React from "react";
import { animals } from "./components/Animals/animals";
import AnimalsCard from "./AnimalsCard";

const AnimalList = () => {

    return (
        <div>
            {animals.mapp((item) => (
                <div>
                    <AnimalsCard key={item.name}
                        name={item.name} />
                </div>
            ))}
        </div>
    )
}
